import React, { Component } from 'react'

export class NameList extends Component {
  render() {
    // const names = ['leela','prasad','bantu']
    // const nameList = names.map(name => <h2>{name}</h2>)

    const persons = [
        {
            id:1,
            name:'leela',
            age:25,
            skill:'react'
        },
        {
            id:2,
            name:'prasad',
            age:26,
            skill:'angular'
        },
        {
            id:3,
            name:'bantu',
            age:27,
            skill:'vue'
        }
        ]   

    const personlist = persons.map(person => <h2>I am {person.name}. I am {person.age} years old. I know {person.skill}</h2>)
    return (
      <div>
        {personlist}
        {/* {nameList} */}
      </div>
    )
  }
}

export default NameList
